data['price_change'] = data.groupby('stock_id')['reference_price'].diff()
data['up_down_indicator'] = data['price_change'].apply(lambda x: 1 if x > 0 else 0 if x < 0 else np.nan)
data.dropna(subset=['up_down_indicator'], inplace=True)
